'use client'
import React, { useState } from 'react';
import Link from 'next/link';
import axios from 'axios';
import { signIn } from 'next-auth/react';
import { useRouter } from 'next/navigation';

export default function SigninPage() {
  const router = useRouter();
  const [name, setname] = useState("");
  const [pass, setpass] = useState("");
  const [isLoading, setIsLoading] = useState(false);

  const handleSubmit = () => {
    if (name && pass) {
      setIsLoading(true); 
      signIn('credentials', {
        username: name,
        password: pass,
        redirect: false
      }).then((res) => {
        if (res?.ok) {
          router.push('/user/home');
        } else {
          alert("Invalid credentials");
          setIsLoading(false); 
        }
      });
    } else {
      alert("Please fill in all fields");
    }
  };

  return (
    <div className="flex h-screen">
      <div className="w-1/2 flex items-center justify-center bg-white border-r border-gray-200">
        {isLoading ? (
          <div className="text-center">
            <div className="w-12 h-12 border-4 border-orange-500 border-t-transparent rounded-full animate-spin mx-auto mb-4"></div>
            <p className="text-orange-500 text-lg font-medium">Signing in...</p>
          </div>
        ) : (
          <div className="w-[456px] h-[523px] border border-blue-500 p-8 rounded-lg shadow-md">
            <div className="flex flex-col items-center mb-6">
              <div className="text-orange-500 text-4xl mb-2">
                <img src="data:image/png;base64,"/>
              </div>
              <h2 className="text-orange-500 font-semibold text-xl mb-1">Tasty Kitchens</h2>
              <h3 className="text-lg font-semibold text-gray-800">Sign in</h3>
            </div>
            <form className="space-y-4">
              <div className="mb-4">
                <label className="text-xs text-gray-700 block mb-1" htmlFor="username">
                  USERNAME
                </label>
                <input
                  type="text"
                  id="username"
                  className="w-full border px-3 py-2 text-sm rounded text-black bg-gray-100"
                  onChange={(e) => setname(e.target.value)}
                />
              </div>
              <div className="mb-6">
                <label className="text-xs text-gray-700 block mb-1" htmlFor="password">
                  PASSWORD
                </label>
                <input
                  type="password"
                  id="password"
                  className="w-full border px-3 py-2 text-sm rounded text-black bg-gray-100"
                  onChange={(e) => setpass(e.target.value)}
                />
              </div>
              <button
                type="button"
                className="w-full bg-orange-500 text-white py-2 rounded hover:bg-orange-600 transition duration-200"
                onClick={handleSubmit}
              >
                Submit
              </button>
            </form>
            <p className=" text-gray-500 mt-4 text-xl text-center">
              Don't have an account?{' '}
              <Link href="/user/signup" className="text-orange-500 hover:underline">
                Sign up
              </Link></p>
          </div>
        )}
      </div>
        <div className="w-1/2 h-screen overflow-hidden">
        <img
          src="data:image/png;base64," 
          alt="Food dish"
          className="object-cover w-full h-full"
        />
      </div>
    </div>
  );
}
